import React from 'react';
import { Route } from 'react-router-dom';

import Authentication from './views/auth/Auth.container';
import { AUTH_ROUTES } from './common/constants';
import Dashboard from './views/dashboard/Dashboard.container';
import Employee from './views/employee/Employee.container';
import NotFound from "./components/PageNotFound/NotFound";
import ProtectedComponent from './components/ProtectedComponent';

const AppRoutes = () => [
  <ProtectedComponent
    exact
    key="dashboard"
    Component={Dashboard}
    path={['/dashboard']}
  />,
  <ProtectedComponent
    exact
    key="employee"
    Component={Employee}
    path={['/employee']}
  />,
  <Route
    exact
    component={Authentication}
    path={AUTH_ROUTES}
    key="authentication"
  />,<Route
    exact
    component={NotFound}
    path={'/not-found'}
    key="NotFound"
  />,
];

export default AppRoutes;
